description:
Here's the explainer video on the workflow and gear used for my cover of @ludovinmusic's cue 'Posterity' for Nolan's 'Tenet'. Amazing score, loved the movie (big fan of time-based scifi movies, what else can I say).

Gear used:
@NovationTV Circuit Tracks as the central brain and beats
@yamahaglobal Reface CP for the keys (looove the sounds of this one)
@KorgOfficial Nanokey Studio
@blokas MidiHub
